class Solution(object):
    def dietPlanPerformance(self, calories, k, lower, upper):
        """
        :type calories: List[int]
        :type k: int
        :type lower: int
        :type upper: int
        :rtype: int
        """
        index = 0
        count = 0
        goal = 0
        p = k
        while p:
            count += calories[p-1]
            p -= 1
        while index < len(calories) - k + 1:
            if count > upper:
                goal += 1
            elif count < lower:
                goal -= 1
            if index + k < len(calories):
                count += calories[index+k]
            count -= calories[index]
            index += 1
        return goal

    def _dietPlanPerformance(self, calories, k, lower, upper):
        """
        :type calories: List[int]
        :type k: int
        :type lower: int
        :type upper: int
        :rtype: int
        """
        # Time Limit
        index = 0
        count = 0
        while index < len(calories) - k + 1:
            s = k
            c = 0
            i = index
            while i < len(calories) and s:
                c += calories[i]
                i += 1
                s -= 1
            if c > upper:
                count += 1
            elif c < lower:
                count -= 1
            index += 1
        return count


